import './App.css';

function App() {

  const title = 'Welcome to the new blog';
  const like = 50;

  const person = { name: 'yoshi', age: 30};

  return (
    <div className="App">
      <div className="content">
        <h1>{ title }</h1>

        <p>Liked {like} times</p>

        {/* <p>{person}</p> */}
        <p></p>

      </div>
    </div>
  );
}

export default App;
